(13, '<h4>Formateo:</h4><b>Se crea una nueva disciplina</b>: terapÃ?Â©utica experimental. Se desarrollan ademÃ?Â¡s los fÃ?Â¡rmacos, como principal recurso mÃ?Â©dico. Y llega el auge de la bioquÃ?Â­mica con la revoluciÃ?Â³n tecnolÃ?Â³gica aplicada a la medicina y el desarrollo de la industria farmacÃ?Â©utica.\nLos farmacÃ?Â©uticos en la primera mitad del siglo XX que enseÃ?Â±aban <i>Farmacia </i>en las facultades solÃ?Â­an tener dobles licenciaturas: Farmacia-Ciencias Naturales (botÃ?Â¡nica), <i>Farmacia</i>-Ciencias QuÃ?Â­micas (esta era la mÃ?Â¡s frecuente por el alto contenido de materias comunes) aunque tambiÃ?Â©n habÃ?Â­an farmacÃ?Â©uticos dedicados a la galÃ?Â©nica. Estos farmacÃ?Â©uticos estudiaron con el plan de 1886 (que durÃ?Â³ 50 aÃ?Â±os). La licenciatura constaba de cinco cursos: el preparatorio que se cursaba en una Facultad de Ciencias y se estudiaba AmpliaciÃ?Â³n de FÃ?Â­sica, MineralogÃ?Â­a y BotÃ?Â¡nica, QuÃ?Â­mica general y ZoologÃ?Â­a.\nPrimer curso de Farmacia.- <i>Instrumentos y aparatos de FÃ?Â­sica aplicados a la Farmacia,</i> MineralogÃ?Â­a Aplicada, y ZoologÃ?Â­a Aplicada.\nSegundo Curso de Farmacia.- BotÃ?Â¡nica descriptiva y determinaciÃ?Â³n de plantas medicinales, QuÃ?Â­mica InorgÃ?Â¡nica aplicada a Farmacia.\nTercer Curso de Farmacia.- Materia farmacÃ?Â©utica vegetal, y QuÃ?Â­mica OrgÃ?Â¡nica aplicada a la Farmacia.\nCuarto Curso de Farmacia.- AnÃ?Â¡lisis QuÃ?Â­mico y en particular de los alimentos, medicamentos y venenos, y Farmacia prÃ?Â¡ctica o galÃ?Â©nica, LegislaciÃ?Â³n relativa a la Farmacia, y PrÃ?Â¡cticas de Materia animal, mineral y vegetal.\nCurso de Doctorado.- Se estudiaba QuÃ?Â­mica biolÃ?Â³gica con su anÃ?Â¡lisis, e Historia crÃ?Â­tica de la Farmacia y BibliografÃ?Â­a farmacÃ?Â©utica.1\nEra obligatorio realizar prÃ?Â¡cticas para obtener el doctorado y defender una tesis de investigaciÃ?Â³n.\nLos farmacÃ?Â©uticos de 1890 estaban perfectamente informados de todos los acontecimientos que revolucionaron a la ciencia de la Farmacia (el avance de la QuÃ?Â­mica y la apariciÃ?Â³n de la Medicina Preventiva) con las aportaciones de cientÃ?Â­ficos como <b>Eduardo Jenner</b> (padre de la microbiologÃ?Â­a e InmunologÃ?Â­a que viviÃ?Â³ en el siglo XIX),<b> Louis Pasteur </b>(que generalizÃ?Â³ los experimentos de Jenner sobre vacunaciÃ?Â³n). QuÃ?Â­micos relevantes como <b>Claude Louis Berthollet </b>(n. 1748, mÃ?Â©dico que se dedicÃ?Â³ a la QuÃ?Â­mica), Antoine Lavoisier (ordenÃ?Â³ la QuÃ?Â­mica para que pudiera desarrollarse posteriormente), <b>John Dalton y JÃ?Â¶ns Jacob Berzelius</b> (las dos grandes figuras de la QuÃ?Â­mica Moderna) y el avanzado a su Ã?Â©poca <b>Dmitri IvÃ?Â¡novich MendelÃ?Â©yev</b> (autor del sistema periÃ?Â³dico natural de los elementos quÃ?Â­micos, la tabla periÃ?Â³dica que sigue vigente en nuestros dÃ?Â­as).<div>En 1890 (el siglo XX comenzÃ?Â³ en el siglo XIX en realidad) el <b>farmacÃ?Â©utico </b>avanzado tiene detrÃ?Â¡s del mostrador, no una rebotica amable y acogedora, capaz de albergar agradables tertulias mÃ?Â¡s o menos cientÃ?Â­ficas, sino un autÃ?Â©ntico<i> laboratorio quÃ?Â­mico-farmacÃ?Â©utico </i>donde puede con toda solvencia preparar nuevos medicamentos. Otros farmacÃ?Â©uticos se salen de la oficina de farmacia para crear laboratorios independientes. Posteriormente serÃ?Â¡ la industria farmacÃ?Â©utica la que prepare los nuevos medicamentos relegando la actividad galÃ?Â©nica de los farmacÃ?Â©uticos de Oficina de Farmacia a una importante decadencia durante el siglo XX.', './adjuntos/800px-Capsules1.JPG', 'alvarojaviervera@gmail.com,stfsfe1818@arnet.com.ar,fanava@gmail.com', '2012-09-18'),
